import axios from 'axios';
export default {
  data() {
    return {
      order_data: [],
      status_data: undefined
    };
  },
  methods: {
    async get_orders() {
      await axios.get("http://localhost:8080/api/orders", {
        withCredentials: true
      }).then(res => {
        this.order_data = res.data.order;
        this.status_data = res.data.status;
        console.log(res.data.order);
      });
    }
  },
  mounted() {
    this.get_orders().then(console.log(this.status_data));
  }
};
